import { Heading, Button, useColorMode } from '@chakra-ui/core';
import Layout from '../components/layout/Layout';

const Home = (props) => {
  const { colorMode, toggleColorMode } = useColorMode();
  return (
    <Layout>
      <Heading>HOME</Heading>
      <Button color='brand.300' bg='brand.900' onClick={toggleColorMode}>
        Change Theme
      </Button>
    </Layout>
  );
};

export default Home;
